webpackJsonp([0xe5278c862d3d],{1280:function(A,a){A.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2013-01-16-macademia-nut-pancakes-rain-and-the-polynesian-culture-center/index.md absPath of file >>> MarkdownRemark",html:'<p>I hear it rains a lot in Hawaii in the winter. However, we are favored by the gods (probably because of all the times we visited the Tiki Room at Disneyland), and so we only had one day of major rain. I guess Mondays are like that even in Hawaii.</p>\n<p>Every day should begin with pancakes covered in Macadamia nut cream sauce from Boots and Kimo\'s</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1683-be798effa561e7d294dc5fa0c44546b9-db0af.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1683" title="" src="/static/IMG_1683-be798effa561e7d294dc5fa0c44546b9-b80fa.jpg" srcset="/static/IMG_1683-be798effa561e7d294dc5fa0c44546b9-cf410.jpg 163w,\n/static/IMG_1683-be798effa561e7d294dc5fa0c44546b9-62f2a.jpg 325w,\n/static/IMG_1683-be798effa561e7d294dc5fa0c44546b9-b80fa.jpg 650w,\n/static/IMG_1683-be798effa561e7d294dc5fa0c44546b9-08cb4.jpg 975w,\n/static/IMG_1683-be798effa561e7d294dc5fa0c44546b9-f2bf9.jpg 1300w,\n/static/IMG_1683-be798effa561e7d294dc5fa0c44546b9-fd4ba.jpg 1950w,\n/static/IMG_1683-be798effa561e7d294dc5fa0c44546b9-db0af.jpg 3264w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n \n  <a class="gatsby-resp-image-link" href="/static/IMG_1684-37eb8b03ac39c5a3c98e1ba763feb925-db0af.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1684" title="" src="/static/IMG_1684-37eb8b03ac39c5a3c98e1ba763feb925-b80fa.jpg" srcset="/static/IMG_1684-37eb8b03ac39c5a3c98e1ba763feb925-cf410.jpg 163w,\n/static/IMG_1684-37eb8b03ac39c5a3c98e1ba763feb925-62f2a.jpg 325w,\n/static/IMG_1684-37eb8b03ac39c5a3c98e1ba763feb925-b80fa.jpg 650w,\n/static/IMG_1684-37eb8b03ac39c5a3c98e1ba763feb925-08cb4.jpg 975w,\n/static/IMG_1684-37eb8b03ac39c5a3c98e1ba763feb925-f2bf9.jpg 1300w,\n/static/IMG_1684-37eb8b03ac39c5a3c98e1ba763feb925-fd4ba.jpg 1950w,\n/static/IMG_1684-37eb8b03ac39c5a3c98e1ba763feb925-db0af.jpg 3264w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>At the LDS Temple in Laie</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1694-5c102092658f4b95f07c3fc8c2b63898-f148f.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1694" title="" src="/static/IMG_1694-5c102092658f4b95f07c3fc8c2b63898-b80fa.jpg" srcset="/static/IMG_1694-5c102092658f4b95f07c3fc8c2b63898-cf410.jpg 163w,\n/static/IMG_1694-5c102092658f4b95f07c3fc8c2b63898-62f2a.jpg 325w,\n/static/IMG_1694-5c102092658f4b95f07c3fc8c2b63898-b80fa.jpg 650w,\n/static/IMG_1694-5c102092658f4b95f07c3fc8c2b63898-08cb4.jpg 975w,\n/static/IMG_1694-5c102092658f4b95f07c3fc8c2b63898-f148f.jpg 1280w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>Opening coconuts with a sharp stick while wearing no shirt seems like it should come with a warning label but if you have that body you probably fear nothing but a steroid test:</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1701-e7db7628d5de50a624e2601854881933-39c1a.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1701" title="" src="/static/IMG_1701-e7db7628d5de50a624e2601854881933-b80fa.jpg" srcset="/static/IMG_1701-e7db7628d5de50a624e2601854881933-cf410.jpg 163w,\n/static/IMG_1701-e7db7628d5de50a624e2601854881933-62f2a.jpg 325w,\n/static/IMG_1701-e7db7628d5de50a624e2601854881933-b80fa.jpg 650w,\n/static/IMG_1701-e7db7628d5de50a624e2601854881933-08cb4.jpg 975w,\n/static/IMG_1701-e7db7628d5de50a624e2601854881933-f2bf9.jpg 1300w,\n/static/IMG_1701-e7db7628d5de50a624e2601854881933-fd4ba.jpg 1950w,\n/static/IMG_1701-e7db7628d5de50a624e2601854881933-39c1a.jpg 2448w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>Darin was about to take off his shirt here and really get jiggy:</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1708-65b9abb50024725e72d4d405c75981e9-db0af.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1708" title="" src="/static/IMG_1708-65b9abb50024725e72d4d405c75981e9-b80fa.jpg" srcset="/static/IMG_1708-65b9abb50024725e72d4d405c75981e9-cf410.jpg 163w,\n/static/IMG_1708-65b9abb50024725e72d4d405c75981e9-62f2a.jpg 325w,\n/static/IMG_1708-65b9abb50024725e72d4d405c75981e9-b80fa.jpg 650w,\n/static/IMG_1708-65b9abb50024725e72d4d405c75981e9-08cb4.jpg 975w,\n/static/IMG_1708-65b9abb50024725e72d4d405c75981e9-f2bf9.jpg 1300w,\n/static/IMG_1708-65b9abb50024725e72d4d405c75981e9-fd4ba.jpg 1950w,\n/static/IMG_1708-65b9abb50024725e72d4d405c75981e9-db0af.jpg 3264w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>The food at the Polynesan Cultural Center was mediocre, but the show is amazing. I\'m not sure if the guys from the various islands come as pyromaniacs but they must leave that way. It\'s inspiring to watch other people play with fire. I might have to buy a flaming baton. Sorry no pictures on this one - they forbid the taking of photos and you don\'t want to mess with a group of guys who look like they\'ve been chiseled from stone.</p>\n<p>In depth discussion about the use of a loin cloth in a public performance that involves dancing.</p>\n\n  <a class="gatsby-resp-image-link" href="/static/IMG_1713-63bd202505efd650d4c6c8cd8e0b7d08-db0af.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="IMG 1713" title="" src="/static/IMG_1713-63bd202505efd650d4c6c8cd8e0b7d08-b80fa.jpg" srcset="/static/IMG_1713-63bd202505efd650d4c6c8cd8e0b7d08-cf410.jpg 163w,\n/static/IMG_1713-63bd202505efd650d4c6c8cd8e0b7d08-62f2a.jpg 325w,\n/static/IMG_1713-63bd202505efd650d4c6c8cd8e0b7d08-b80fa.jpg 650w,\n/static/IMG_1713-63bd202505efd650d4c6c8cd8e0b7d08-08cb4.jpg 975w,\n/static/IMG_1713-63bd202505efd650d4c6c8cd8e0b7d08-f2bf9.jpg 1300w,\n/static/IMG_1713-63bd202505efd650d4c6c8cd8e0b7d08-fd4ba.jpg 1950w,\n/static/IMG_1713-63bd202505efd650d4c6c8cd8e0b7d08-db0af.jpg 3264w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    ',frontmatter:{title:"Macademia Nut Pancakes, Rain and the Polynesian Culture Center",date:"January 16, 2013",imageUrl:null,image:{childImageSharp:{sizes:{src:"/static/IMG_1683-be798effa561e7d294dc5fa0c44546b9-381d6.jpg"}}}}}},pathContext:{path:"/macademia-nut-pancakes-rain-and-the-polynesian-culture-center"}}}});
